import { Carousel } from "react-bootstrap";

import React from "react";

export default class CarouselHeader extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Carousel>
        <Carousel.Item></Carousel.Item>
        {this.props.convoCard}
      </Carousel>
    );
  }
}
